import {useState} from "react";
import moment from "moment";
export function LazyLoadingDemo(){
    let [time,setTime]=useState(Date.now());
    return (
        <div>
        <div>{time}</div>
        <button onClick={()=>{setTime(moment(Date.now()).format())}}>
        格式化时间
        </button>
    </div>

)
}
